import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from 'react-router-dom';

const Signup: React.FC = () => {
    const navigate = useNavigate();
    const [formData, setFormData] = useState<{
        firstName: string;
        lastName: string;
        email: string;
        password: string;
        confirmPassword: string;
        phone: string;
        gender: string;
        userType: string;
        hobbies: string[];
        profileImage: File | null;
        resume: File | null;
        agency: string;
    }>({
        firstName: '',
        lastName: '',
        email: '',
        password: '',
        confirmPassword: '',
        phone: '',
        gender: '',
        userType: 'Job Seeker', // Default value
        hobbies: [],
        profileImage: null,
        resume: null,
        agency: '',
    });

    const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
        const { name, value, type, checked } = e.target;
        if (type === 'checkbox') {
            setFormData(prev => ({
                ...prev,
                hobbies: checked
                    ? [...prev.hobbies, value]
                    : prev.hobbies.filter(hobby => hobby !== value),
            }));
        } else if (type === 'file') {
            if (name === 'profileImage') {
                setFormData({ ...formData, profileImage: e.target.files?.[0] || null });
            } else if (name === 'resume') {
                setFormData({ ...formData, resume: e.target.files?.[0] || null });
            }
        } else {
            setFormData({ ...formData, [name]: value });
        }
    };

    const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        const data = new FormData();
        for (const key in formData) {
            data.append(key, formData[key as keyof typeof formData]);
        }

        try {
            await axios.post('http://localhost:5001/api/signup', data);
            alert('Signup successful! Please login.');
            navigate("/login");
        } catch (error) {
            alert('Error signing up. Please try again.');
        }
    };

    return (
        <div className="container mt-5">
            <h2 className="text-center">Sign Up</h2>
            <form onSubmit={handleSubmit} className="w-50 mx-auto">
                <div className="mb-3">
                    <input
                        name="firstName"
                        onChange={handleChange}
                        required
                        placeholder="First Name"
                        className="form-control"
                    />
                </div>
                <div className="mb-3">
                    <input
                        name="lastName"
                        onChange={handleChange}
                        required
                        placeholder="Last Name"
                        className="form-control"
                    />
                </div>
                <div className="mb-3">
                    <input
                        name="email"
                        type="email"
                        onChange={handleChange}
                        required
                        placeholder="Email"
                        className="form-control"
                    />
                </div>
                <div className="mb-3">
                    <input
                        name="password"
                        type="password"
                        onChange={handleChange}
                        required
                        placeholder="Password"
                        className="form-control"
                    />
                </div>
                <div className="mb-3">
                    <input
                        name="confirmPassword"
                        type="password"
                        onChange={handleChange}
                        required
                        placeholder="Confirm Password"
                        className="form-control"
                    />
                </div>
                <div className="mb-3">
                    <input
                        name="phone"
                        type="tel"
                        onChange={handleChange}
                        required
                        placeholder="Phone"
                        className="form-control"
                    />
                </div>
                <div className="mb-3">
                    <label>Gender:</label>
                    <div>
                        <label>
                            <input
                                type="radio"
                                name="gender"
                                value="Male"
                                onChange={handleChange}
                                required
                            /> Male
                        </label>
                        <label>
                            <input
                                type="radio"
                                name="gender"
                                value="Female"
                                onChange={handleChange}
                                required
                            /> Female
                        </label>
                        <label>
                            <input
                                type="radio"
                                name="gender"
                                value="Other"
                                onChange={handleChange}
                                required
                            /> Other
                        </label>
                    </div>
                </div>
                <div className="mb-3">
                    <label>User Type:</label>
                    <select name="userType" onChange={handleChange} className="form-control">
                        <option value="Job Seeker">Job Seeker</option>
                        <option value="Agency">Agency</option>
                    </select>
                </div>
                <div className="mb-3">
                    <label>Hobbies:</label>
                    <div>
                        <label>
                            <input
                                type="checkbox"
                                name="hobbies"
                                value="Sports"
                                onChange={handleChange}
                            /> Sports
                        </label>
                        <label>
                            <input
                                type="checkbox"
                                name="hobbies"
                                value="Dance"
                                onChange={handleChange}
                            /> Dance
                        </label>
                        <label>
                            <input
                                type="checkbox"
                                name="hobbies"
                                value="Reading"
                                onChange={handleChange}
                            /> Reading
                        </label>
                        <label>
                            <input
                                type="checkbox"
                                name="hobbies"
                                value="Singing"
                                onChange={handleChange}
                            /> Singing
                        </label>
                    </div>
                </div>
                <div className="mb-3">
                    <input
                        name="profileImage"
                        type="file"
                        accept=".png, .jpg, .jpeg"
                        onChange={handleChange}
                        required
                        className="form-control"
                    />
                </div>
                {formData.userType === 'Job Seeker' && (
                    <div className="mb-3">
                        <input
                            name="resume"
                            type="file"
                            accept=".pdf, .docx"
                            onChange={handleChange}
                            required
                            className="form-control"
                        />
                    </div>
                )}
                {formData.userType === 'Job Seeker' && (
                    <div className="mb-3">
                        <select name="agency" onChange={handleChange} className="form-control" required>
                            <option value="">Select Agency</option>
                            <option value="Agency A">Agency A</option>
                            <option value="Agency B">Agency B</option>
                            {/* Add more agencies as needed */}
                        </select>
                    </div>
                )}
                <button type="submit" className="btn btn-primary w-100">Sign Up</button>
                <div className="mt-3 text-center">
                    <a href="/login">Already have an account? Login</a>
                </div>
            </form>
        </div>
    );
};

export default Signup;
